import Nav from 'react-bootstrap/Nav';
import { Link } from "react-router-dom";
import "../index.css"

const InicioSecion = () => {
  return (

    <div className="bodyLogin">
      <Nav className=" nav p-4 justify-content-end">
      <Link to="/Registro">Unete a market place</Link>
      </Nav>

      <div className="login">
        <div className="form">
        <h1>Marketplace</h1>
      </div>
      </div>
    </div>

  )
}

export default InicioSecion
